class MatchHistory {
  constructor(matchHistoryIds) {
    console.log(matchHistoryIds)
    for (const matchId of matchHistoryIds) {
      this.matches = { matchId: null }
    }
    this.ids = matchHistoryIds;
    this.data = null;
  }
}

export default MatchHistory;
